import React, { useContext } from 'react'
import "./Footer.css"
import { Data } from '../../context/Userdata'
export default function Footer() {
  const b = useContext(Datas)
  const func = (i) =>{
    b.setlinkpointer(true)
  }
  return (
    <div id='footer'>
      <h2>All Rights Reserved</h2>
      <div>
        <button onClick={()=>{func(0)}}><img height="30px" src={process.env.PUBLIC_URL + "/svg/github142.svg"} alt="None" /></button>
        <button><img height="40px" src={process.env.PUBLIC_URL + "/svg/telegram.svg"} alt="None" /></button>
        <button><img height="30px" src={process.env.PUBLIC_URL + "/svg/instagram.svg"} alt="None" /></button>
        <button><img height="30px" src={process.env.PUBLIC_URL + "/svg/leetcode.svg"} alt="None" /></button>
      </div>
    </div>
  )
}
